# 👋 Hey there, I’m Sarah Aljudaibi 

> “Turning data into insights, insights into action, and action into… more data.”

## 🎨 Data Scientist • Creative Hybrid

I blend data science with artistic intuition, because why shouldn’t a scatter plot also be beautiful?
I love exploring patterns, building models, creating visual stories, and sometimes generating pixel art just because my brain said “what if…?”

At any moment, you might find me:

* 🧪 cleaning data like I'm on a reality show
* 🎨 sketching ideas that eventually turn into models
* 📊 building dashboards that my friends pretend to understand
* 🤖 teaching computers how to make decisions (better than I do)
* 🍵 analyzing life problems using statistics (0/10 recommended)

## 🧰 Data Science Toolbox

> If it's in my toolbox, it’s probably been overused in at least two projects.

